import React, { useState } from 'react';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import CardMusic from "./CardMusic";
import "./../../../node_modules/flickity/dist/flickity.min.css";


function CardGroupSearch(params) {

    var arr = []
    for (let i = 0; i < params.params.length; i++) {
        const element = params.params[i];
        arr.push(element);
    }
    // row row-cols-1 row-cols-md-2 g-4
    return (
        <div className="container">
            <div className="row row-cols-1 row-cols-md-2 g-4">
                {/* <div className="col-lg-3"> */}
                    {
                        arr.map((p, index) => {
                            return (
                                <div className="col-lg-3 col-md-4 py-2">
                                    <CardMusic trackName={p.trackName} artists={p.artists} imageUrl={p.imageUrl} trackPreviewUrl={p.spotifyLink} />
                                </div>
                            );
                        })
                    }
                {/* </div> */}
            </div>
        </div>
    );
}

export default CardGroupSearch;
